import { 
  Box
} from '@material-ui/core';

import '../styling/remixComponent.css';


const RemixComponent = (
  Number: number,
  Cover: string,
  Title: string,
  Artist: string
) => {  
  return(
    <Box
      id='remix-component'
    >
      {Number}
      {Cover}
       
      <Box
        id='remix-title-artist'
      >
        {Title} 
        {Artist}
      </Box>
    </Box>
    )
}

export default RemixComponent;
